import { Box, Button, Typography, useTheme, IconButton } from "@mui/material";
import { tokens } from "../../theme";
import { mockTransactions } from "../../data/mockData";
import DownloadOutlinedIcon from "@mui/icons-material/DownloadOutlined";
import Header from "../../components/Header";
import LineChart from "../../components/LineChart";
import GeographyChart from "../../components/GeographyChart";
import BarChart from "../../components/BarChart";
import StatBox from "../../components/StatBox";
import ProgressCircle from "../../components/ProgressCircle";
import axios from "axios";
import React, { useState, useEffect } from "react";
import DesignServicesIcon from '@mui/icons-material/DesignServices';
import PeopleAltIcon from '@mui/icons-material/PeopleAlt';
import EngineeringIcon from '@mui/icons-material/Engineering';
import DomainIcon from '@mui/icons-material/Domain';

const Domainboard = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  const [statistics, setStatistics] = useState({
    designers: 0,
    customers: 0,
    engineers: 0,
    domainLeaders: 0
  });

  useEffect(() => {
    fetchData(); // Fetch data when the component mounts
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get(`http://localhost:3000/statistics`);
      setStatistics(response.data); // Update state with the response data
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  const totalDesigners = statistics.designers; 
  const totalcustomers = statistics.customers;
  const totalEngineers = statistics.engineers;
  const totalDomain = statistics.domainLeaders;
  const maxCusotmers = 100;
  const maxDesigners = 100; 
  const maxEngineers = 100;
  const maxDomain = 100;
  const progress_c = totalcustomers / maxCusotmers;
  const progress_i = totalDesigners / maxDesigners; 
  const progress_e = totalEngineers / maxEngineers;
  const progress_d = totalDomain / maxDomain;

  const handleDownloadReport = () => {
    const reportData = `
      Statistics Report
      -----------------
      Total IC Designers: ${totalDesigners}
      Total Customers: ${totalcustomers}
      Total Engineers: ${totalEngineers}
      Total Domain Leaders: ${totalDomain}
    `;

    const blob = new Blob([reportData], { type: 'text/plain' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'report.txt';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    window.URL.revokeObjectURL(url);
  };

  return (
    <Box m="20px">
      {/* HEADER */}
      <Box display="flex" justifyContent="space-between" alignItems="center">
        <Header title="DASHBOARD" subtitle="Welcome to your dashboard" />

        <Box>
          <Button
            onClick={handleDownloadReport}
            sx={{
              backgroundColor: colors.blueAccent[700],
              color: colors.grey[100],
              fontSize: "14px",
              fontWeight: "bold",
              padding: "10px 20px",
              borderRadius: "10px", // Rounded edges
            }}
          >
            <DownloadOutlinedIcon sx={{ mr: "10px" }} />
            Download Reports
          </Button>
        </Box>
      </Box>

      {/* GRID & CHARTS */}
      <Box
        display="grid"
        gridTemplateColumns="repeat(12, 1fr)"
        gridAutoRows="140px"
        gap="20px"
      >
        {/* ROW 1 */}
        <Box
          gridColumn="span 3"
          backgroundColor={colors.primary[400]}
          display="flex"
          alignItems="center"
          justifyContent="center"
          borderRadius="10px" // Rounded edges
        >
          <StatBox
            title={statistics.designers}
            subtitle="Total IC Designers"
            progress={progress_i}
            increase="+14%"
            icon={
              <DesignServicesIcon
                sx={{ color: colors.greenAccent[600], fontSize: "26px" }}
              />
            }
          />
        </Box>
        <Box
          gridColumn="span 3"
          backgroundColor={colors.primary[400]}
          display="flex"
          alignItems="center"
          justifyContent="center"
          borderRadius="10px" // Rounded edges
        >
          <StatBox
            title={statistics.customers}
            subtitle="Total Customers"
            progress={progress_c}
            increase="+21%"
            icon={
              <PeopleAltIcon
                sx={{ color: colors.greenAccent[600], fontSize: "26px" }}
              />
            }
          />
        </Box>
        <Box
          gridColumn="span 3"
          backgroundColor={colors.primary[400]}
          display="flex"
          alignItems="center"
          justifyContent="center"
          borderRadius="8px" // Rounded edges
        >
          <StatBox
            title={statistics.engineers}
            subtitle="Total Engineers"
            progress={progress_e}
            increase="+5%"
            icon={
              <EngineeringIcon
                sx={{ color: colors.greenAccent[600], fontSize: "26px" }}
              />
            }
          />
        </Box>
        <Box
          gridColumn="span 3"
          backgroundColor={colors.primary[400]}
          display="flex"
          alignItems="center"
          justifyContent="center"
          borderRadius="8px" // Rounded edges
        >
          <StatBox
            title={statistics.domainLeaders}
            subtitle="Total Domain Leaders"
            progress={progress_d}
            increase="+43%"
            icon={
              <DomainIcon
                sx={{ color: colors.greenAccent[600], fontSize: "26px" }}
              />
            }
          />
        </Box>

        {/* ROW 2 */}
        <Box
          gridColumn="span 8"
          gridRow="span 2"
          backgroundColor={colors.primary[400]}
          borderRadius="8px" // Rounded edges
        >
          <Box
            mt="25px"
            p="0 30px"
            display="flex "
            justifyContent="space-between"
            alignItems="center"
          >
            <Box>
              <Typography
                variant="h5"
                fontWeight="600"
                color={colors.grey[100]}

              >
                Revenue Generated
              </Typography>
              <Typography
                variant="h3"
                fontWeight="bold"
                color={colors.greenAccent[500]}
              >
                $59,342.32
              </Typography>
            </Box>
            <Box>
              <IconButton>
                <DownloadOutlinedIcon
                  sx={{ fontSize: "26px", color: colors.greenAccent[500] }}
                />
              </IconButton>
            </Box>
          </Box>
          <Box height="250px" m="-20px 0 0 0">
            <LineChart isDashboard={true} />
          </Box>
        </Box>
        <Box
          gridColumn="span 4"
          gridRow="span 2"
          backgroundColor={colors.primary[400]}
          overflow="auto"
          borderRadius="8px" // Rounded edges
        >
          <Box
            display="flex"
            justifyContent="space-between"
            alignItems="center"
            borderBottom={`4px solid ${colors.primary[500]}`}
            colors={colors.grey[100]}
